// import PropTypes from 'prop-types';
import css from './Projects.module.css';

export const Projects = () => {
  return (
    <div className={css.box}>
      <div>
        <h2 className={css.title}>Projects</h2>
      </div>
      <div>
        <h3 className={css.project}>IceCream</h3>
        <p className={css.description}>
          Ice Cream company site. Neat and tasty design, responsible for the
          layout. Using Parcel, SCSS, JS
        </p>
        <a href="https://annamichalowska.github.io/Ice-Cream-Project-GoIT/">
          SITE
        </a>
        <a href="https://annamichalowska.github.io/Ice-Cream-Project-GoIT/">
          GITHUB
        </a>
      </div>
    </div>
  );
};
